style.css:
body {
  /* Set the background image */
  background-image: url(data:image/jpeg;base64,); /* Replace 'path/to/your/image.jpg' with the actual path to your image */

  /* Set background properties */
  background-size: cover; /* Cover the entire background */
  background-repeat: no-repeat; /* Prevent background image from repeating */
  background-position: center center; /* Center the background image */
  margin: 0; /* Remove default margin */
  padding: 0; /* Remove default padding */
  height: 100%; /* Set body height to 100% */
  width: 100%; /* Set body width to 100% */

  /* Other styles for the body */
  margin: 0;
  padding: 0;
  font-family: Arial, sans-serif; /* Example font-family */
  color: #FFFFFF; /* Text color on the background */
}
